void MainTask(void)
{
	GUI_ClearRect(0, 0, 240, 320);
	BUTTON_Handle hCompassBt, hCalibrationBt;
	
	GUI_SetBkColor(backgroundColor);
	
	hCompassBt = BUTTON_CreateEx(40, 100, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON0);
	BUTTON_SetBitmap(hCompassBt, BUTTON_BI_UNPRESSED, &bmcompass);
	
	hCalibrationBt = BUTTON_CreateEx(136, 100, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON1);
	BUTTON_SetBitmap(hCalibrationBt, BUTTON_BI_UNPRESSED, &bmsettings);
	
	COMPASS_Init();
	GUI_Exec();
	while(1)
	{

		if(BUTTON_IsPressed(hCompassBt))
		{
			BUTTON_Delete(hCompassBt);
			BUTTON_Delete(hCalibrationBt);
			GUI_ClearRect(0, 0, 240, 320);
			BSP_LED_On(LED3);
			GUI_Exec();
			CreateCompassWindow2();
		}
		
		else if(BUTTON_IsPressed(hCalibrationBt))	
		{
			BUTTON_Delete(hCalibrationBt);
			BUTTON_Delete(hCompassBt);
			GUI_ClearRect(0, 0, 240, 320);
			BSP_LED_Off(LED3);
			GUI_Exec();
			CreateSettingsWindow();
		}
		GUI_Delay(100);
	}
}

static void CreateCompassWindow2(void)
{
	GUI_ClearRect(0, 0, 240, 320);
	BUTTON_Handle hBackBt, hCalibrationBt;
	hBackBt = BUTTON_CreateEx(10, 250, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON0);
	BUTTON_SetBitmap(hBackBt, BUTTON_BI_UNPRESSED, &bmimages);
	
	hCalibrationBt = BUTTON_CreateEx(166, 250, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON1);
	BUTTON_SetBitmap(hCalibrationBt, BUTTON_BI_UNPRESSED, &bmcalibration_mark);
	
	uint16_t i = 0;
	double heading = 0;
	GUI_RECT rect[] = {90, 80, 150, 140};
	
	GUI_SetBkColor(backgroundColor);
	
	GUI_SetColor(compassColor);
	
	for(i = 0; i<10; i++)
	{
		GUI_DrawCircle(120, 130, 103+i);
	}
	drawMainDirection(0);
	drawMainDirection(90);
	drawMainDirection(180);
	drawMainDirection(270);
	drawSecondaryDirection(30);
	drawSecondaryDirection(60);
	drawSecondaryDirection(120);
	drawSecondaryDirection(150);
	drawSecondaryDirection(210);
	drawSecondaryDirection(240);
	drawSecondaryDirection(300);
	drawSecondaryDirection(330);
	
	
	GUI_Exec();
	while(1)
	{
		if(BUTTON_IsPressed(hBackBt))
		{
			BUTTON_Delete(hBackBt);
			BUTTON_Delete(hCalibrationBt);
			GUI_ClearRect(0, 0, 240, 320);
			MainTask();
		}
		else if(BUTTON_IsPressed(hCalibrationBt))
		{
			BUTTON_Delete(hBackBt);
			BUTTON_Delete(hCalibrationBt);
			GUI_ClearRect(0, 0, 240, 320);
			CreateCalibrationWindow2();
		}
		else
		{
			if(COMPASS_OK == COMPASS_GetHeading(&heading))
			{
				startTime = GUI_GetTime();
				
				COMPASS_Status_T statusCompass = COMPASS_OK;
				GUI_ClearRect(90, 90, 160, 170);
			
				GUI_SetFont(&GUI_Font32B_1);
				GUI_GotoXY(95,140);  
				GUI_DispDecSpace(heading, 3);
				
				if(0 == arrowShape)
				{
				drawPolygon(360-heading);
				}
				else if(1 == arrowShape)
				{
					drawTriangle(360-heading);
				}
				else
				{
					drawCircle(360-heading);
				}

				if(heading >= 338 || heading <= 23) 
					GUI_DispStringInRect("N", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
				else if(heading >= 24 && heading <= 68)
					GUI_DispStringInRect("NE", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
				else if(heading >= 69 && heading <= 113)
					GUI_DispStringInRect("E", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
				else if(heading >= 114 && heading <= 158)
					GUI_DispStringInRect("SE", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
				else if(heading >= 159 && heading <= 203)
					GUI_DispStringInRect("S", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
				else if(heading >= 204 && heading <= 248)
					GUI_DispStringInRect("SW", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
				else if(heading >= 249 && heading <= 293)
					GUI_DispStringInRect("W", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
				else if(heading >= 294 && heading <= 338)
					GUI_DispStringInRect("NW", rect, GUI_TA_HCENTER | GUI_TA_VCENTER);
			  stopTime = GUI_GetTime();
				tempTime = stopTime - startTime;
			} 

		}
		GUI_Delay(95);
	}
}

static void CreateCalibrationWindow2(void)
{
	GUI_ClearRect(0, 0, 240, 320);
	BUTTON_Handle hBackBt;
	int16_t mag_reading[2];
	int16_t mag_x[2] = {300, 0};
	int16_t mag_y[2] = {300, 0};
	MAG_Status_T statusMAG = MAG_OK;
	
	GUI_SetFont(&GUI_Font8x16);
	PROGBAR_Handle hProgbar;
	hProgbar = PROGBAR_CreateEx(10, 10, 220, 30, 0, WM_CF_SHOW, 0, GUI_ID_PROGBAR0);
	PROGBAR_SetFont(hProgbar, &GUI_Font8x16);
	PROGBAR_SetText(hProgbar, "LOADING..CZEKAJ..");
	PROGBAR_SetMinMax(hProgbar, 0, 200);
	uint16_t i = 0;
	
	GUI_DispDecAt(mag_x[0], 120, 100, 4);
	GUI_DispDecAt(mag_x[1], 120, 120, 4);
	GUI_DispDecAt(mag_y[0], 120, 140, 4);
	GUI_DispDecAt(mag_y[1], 120, 160, 4);
	
	GUI_Exec();
	GUI_Delay(10);
	
	GUI_SetBkColor(backgroundColor);
	

	while(1)
	{
		if(BUTTON_IsPressed(hBackBt) && i>200 )
				{
					BUTTON_Delete(hBackBt);
					GUI_ClearRect(0, 0, 240, 320);
					PROGBAR_Delete(hProgbar);
					MainTask();
				}
		else
		{
			if(i<=200)
			{
				PROGBAR_SetValue(hProgbar, i);
				MAGNETO_StartForcedMeasure();
				statusMAG |= MAGNETO_ReadAxis(MAG_X_AXIS, &mag_reading[0]);
				statusMAG |= MAGNETO_ReadAxis(MAG_Y_AXIS, &mag_reading[1]);
				
				if(mag_reading[0] > mag_x[1]) //sprawdzenie czy aktualna jest wieksza od najwiekszej 
					mag_x[1] = mag_reading[0];  //xmax
				
				if(mag_reading[0] < mag_x[0]) //sprawdzenie czy aktualna jest mniejsza od najmniejszej
					mag_x[0] = mag_reading[0];  //xmin
				
				if(mag_reading[1] > mag_y[1])
					mag_y[1] = mag_reading[1];  //ymax
				
				if(mag_reading[1] < mag_y[0])
					mag_y[0] = mag_reading[1];  //ymin
				
				i++;
				GUI_DispStringAt("X Min: ", 60, 100);
				GUI_DispDecAt(mag_x[0], 120, 100, 4);
				GUI_DispStringAt("X Max: ", 60, 120);
				GUI_DispDecAt(mag_x[1], 120, 120, 4);
				GUI_DispStringAt("Y Min: ", 60, 140);
				GUI_DispDecAt(mag_y[0], 120, 140, 4);
				GUI_DispStringAt("Y Max: ", 60, 160);
				GUI_DispDecAt(mag_y[1], 120, 160, 4);
			}
			else if(i==201)
			{
				hBackBt = BUTTON_CreateEx(10, 250, 64, 64, 0, WM_CF_SHOW, 0, GUI_ID_BUTTON0);
				BUTTON_SetBitmap(hBackBt, BUTTON_BI_UNPRESSED, &bmimages);
				PROGBAR_Delete(hProgbar);
				
				x_error = (mag_x[0] + mag_x[1]) * 0.5;
				y_error = (mag_y[0] + mag_y[1]) * 0.5;
				
				GUI_DispStringAt("X error: ", 40, 210);
				GUI_DispDecAt(x_error, 120, 210, 2);
				GUI_DispStringAt("Y error: ", 40, 230);
				GUI_DispDecAt(y_error, 120, 230, 2);
				i++;	
			}
		}
		GUI_Delay(99); //99
	}
}

