static void drawPolygon(uint16_t j)
{
	unsigned int XA, YA, XB, YB, XC, YC, XD, YD;
	float fi = 0.0;
	static GUI_POINT points[4];
	static GUI_POINT oldPoints[4];
	

	fi = j * DEG_TO_RAD;
	XA = (RADIUS_POLYGON_LONG * cosf(fi - PI/2)) + X_MIDDLE;
	YA = (RADIUS_POLYGON_LONG * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XB = (RADIUS_POLYGON_SHORT * cosf(fi - (PI/2 + PI/18))) + X_MIDDLE;
	YB = (RADIUS_POLYGON_SHORT * sinf(fi - (PI/2 + PI/18))) + Y_MIDDLE;

	XC = (RADIUS_POLYGON_MIDDLE * cosf(fi - PI/2)) + X_MIDDLE;
	YC = (RADIUS_POLYGON_MIDDLE * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XD = (RADIUS_POLYGON_SHORT * cosf(fi - (PI/2 - PI/18))) + X_MIDDLE;
	YD = (RADIUS_POLYGON_SHORT * sinf(fi - (PI/2 - PI/18))) + Y_MIDDLE;

	points[0].x = XA;
	points[0].y = YA;

	points[1].x = XB;
	points[1].y = YB;
	
	points[2].x = XC;
	points[2].y = YC;
	
	points[3].x = XD;
	points[3].y = YD;
	
	GUI_SetColor(backgroundColor);
	GUI_FillPolygon(oldPoints, 4, 0, 0);
	
	GUI_SetColor(arrowColor);
	GUI_FillPolygon(points, 4, 0, 0);
	
	for(unsigned int i = 0; i<4; i++)
	{
		oldPoints[i] = points[i];
	}
		
}		

static void drawCircle(uint16_t j)
{
	unsigned int X, Y;
	static unsigned int oldX, oldY;
	float fi = 0.0;
	
	fi = j * DEG_TO_RAD;
	
	X = (RADIUS_CIRCLE_BIG * cosf(fi - PI/2)) + X_MIDDLE;
	Y = (RADIUS_CIRCLE_BIG * sinf(fi - PI/2)) + Y_MIDDLE;
	
	GUI_SetColor(backgroundColor);
	GUI_FillCircle(oldX, oldY, RADIUS_CIRCLE_SMALL);
	
	GUI_SetColor(arrowColor);
	GUI_FillCircle(X, Y, RADIUS_CIRCLE_SMALL);
	
	oldX = X;
	oldY = Y;
}

