	YA = (RADIUS_POLYGON_LONG * sinf(fi - PI/2)) + Y_MIDDLE;
	
	XB = (RADIUS_POLYGON_SHORT * cosf(fi - (PI/2 + PI/12))) + X_MIDDLE;
	YB = (RADIUS_POLYGON_SHORT * sinf(fi - (PI/2 + PI/12))) + Y_MIDDLE;
	
	XC = (RADIUS_POLYGON_SHORT * cosf(fi - (PI/2 - PI/12))) + X_MIDDLE;
	YC = (RADIUS_POLYGON_SHORT * sinf(fi - (PI/2 - PI/12))) + Y_MIDDLE;
	
	points[0].x = XA;
